CREATE PROCEDURE ProductoGetAll
AS
SELECT IdProducto
      ,Nombre
      ,Descripcion
      ,Precio
      ,Imagen
      ,Stock
  FROM Producto
GO



CREATE PROCEDURE ProductoGetById
@IdProducto INT
AS
SELECT IdProducto
      ,Nombre
      ,Descripcion
      ,Precio
      ,Imagen
      ,Stock
  FROM Producto
  WHERE IdProducto = @IdProducto
GO

CREATE PROCEDURE ProductoAdd
@Nombre varchar(50),
@Descripcion varchar(100),
@Precio decimal(18,2),
@Imagen varbinary(max),
@Stock INT
AS
INSERT INTO Producto
           (Nombre
           ,Descripcion
           ,Precio
           ,Imagen
           ,Stock)
     VALUES
           (@Nombre
           ,@Descripcion
           ,@Precio
           ,@Imagen
           ,@Stock)
GO

CREATE PROCEDURE ProductoUpdate
@IdProducto INT,
@Nombre varchar(50),
@Descripcion varchar(100),
@Precio decimal(18,2),
@Imagen varbinary(max),
@Stock INT
AS
UPDATE Producto
SET
Nombre = @Nombre,
Descripcion = @Descripcion,
Precio = @Precio,
Imagen = @Imagen,
Stock = @Stock
WHERE IdProducto = @IdProducto
GO

CREATE PROCEDURE ProductoDelete
@IdProducto INT
AS
DELETE FROM Producto WHERE IdProducto = @IdProducto
GO
