----------------------------ProductosPorSucursal
CREATE PROCEDURE ProductosGetAsignadosByIdSucursal
@IdSucursal INT
AS
SELECT
SucursalProducto.IdSucursalProducto,
Sucursal.IdSucursal,
Sucursal.Nombre AS SucursalNombre,
Sucursal.Direccion,
Sucursal.Telefono,
Producto.IdProducto,
Producto.Nombre as ProductoNombre,
Producto.Descripcion,
Producto.Precio,
Producto.Imagen,
Producto.Stock
FROM SucursalProducto
INNER JOIN
Sucursal on SucursalProducto.IdSucursal = Sucursal.IdSucursal
INNER JOIN
Producto on SucursalProducto.IdProducto = Producto.IdProducto
WHERE SucursalProducto.IdSucursal = @IdSucursal
GO

CREATE PROCEDURE ProductosGetNoAsignadosByIdSucursal
@IdSucursal INT
AS
SELECT
Producto.IdProducto,
Producto.Nombre as ProductoNombre,
Producto.Descripcion,
Producto.Precio,
Producto.Imagen,
Producto.Stock
FROM Producto
WHERE Producto.IdProducto NOT IN 
(SELECT SucursalProducto.IdProducto
FROM SucursalProducto
WHERE SucursalProducto.IdSucursal = @IdSucursal)
GO

CREATE PROCEDURE SucursalProductoDelete
@IdSucursalProducto INT
AS
DELETE FROM SucursalProducto
	WHERE IdSucursalProducto = @IdSucursalProducto